  [ChainId.MAINNET]: '0x443d7fad26D2914341Aac95979ade902d7b7D273', // TODO
  [ChainId.BSCTESTNET]: '0x443d7fad26D2914341Aac95979ade902d7b7D273'
}

export { MULTICALL_ABI, MULTICALL_NETWORKS }
